document.getElementById('recommendButton').addEventListener('click', function() {
    // 카테고리 선택
    const selectedCategory = document.getElementById('categorySelect').value;

    // 각 카테고리별 메뉴와 이미지 URL
    const menus = {
        korean: [
            { name: "김치찌개", image: "https://example.com/idata:image/jpeg;base64,-jjigae.jpg" },
            { name: "된장찌개", image: "https://edata:image/jpeg;base64,.com/images/doenjang-jjigae.jpg" },
            { name: "비빔밥", image: "https://exadata:image/jpeg;base64,.com/images/bibimbap.jpg" },
            { name: "삼겹살", image: "https://example.com/images/data:image/jpeg;base64,.jpg" },
            { name: "불고기", image: "https://example.com/images/bdata:image/jpeg;base64,.jpg" },
            { name: "갈비탕", image: "https://example.com/images/galbidata:image/jpeg;base64,.jpg" },
            { name: "제육볶음", image: "httpsdata:image/jpeg;base64,://example.com/images/je-yuk-bokkeum.jpg" }
        ],
        western: [
            { name: "스파게티", image: "https://example.comdata:image/jpeg;base64,.jpg" },
            { name: "피자", image: "https://example.com/images/pdata:image/jpeg;base64,.jpg" },
            { name: "햄버거", image: "https://example.com/imagesdata:image/jpeg;base64,.jpg" },
            { name: "리조또", image: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcS2rE1XWtm05qb6g92RHnX4GIJk86mJLjwnYA&s" },
            { name: "치킨", image: "https://example.com/imagesdata:image/jpeg;base64,.jpg" },
            { name: "스테이크", image: "httpsdata:image/jpeg;base64,://example.com/images/steak.jpg" }
        ],
        snack: [
            { name: "떡볶이", image: "htdata:image/jpeg;base64,://example.com/images/tteokbokki.jpg" },
            { name: "오뎅", image: "https://example.com/images/odata:image/jpeg;base64,.jpg" },
            { name: "순대", image: "httpsdata:image/jpeg;base64,://example.com/images/sundae.jpg" },
            { name: "튀김", image: "data:image/jpeg;base64," },
            { name: "김밥", image: "https://example.comdata:image/jpeg;base64,.jpg" },
            { name: "라면", image: "https://example.com/images/rdata:image/jpeg;base64,.jpg" },
            { name: "호떡", image: "https://example.com/images/hdata:image/jpeg;base64,.jpg" }
        ]
    };

    // 선택된 카테고리의 메뉴 리스트
    const selectedMenus = menus[selectedCategory];

    // 무작위로 메뉴 추천
    const randomIndex = Math.floor(Math.random() * selectedMenus.length);
    const recommendedMenu = selectedMenus[randomIndex];

    // 결과 div를 보이게 하고 애니메이션 효과 적용
    const resultElement = document.getElementById('recommendedMenu');
    resultElement.textContent = recommendedMenu.name;

    // 이미지 표시
    const imageElement = document.getElementById('recommendedImage');
    imageElement.src = recommendedMenu.image;
    imageElement.style.display = 'block';  // 이미지를 표시하도록 설정

    // 결과 영역을 서서히 나타나게 하는 효과
    resultElement.classList.add('animate__animated', 'animate__fadeIn', 'animate__delay-1s');
    resultElement.style.display = 'block'; // 숨겨진 상태에서 나타나도록

    // 메뉴 추천 후 "bounce" 효과로 살짝 튕기는 애니메이션 추가
    setTimeout(() => {
        resultElement.classList.add('animate__bounce');
    }, 1000); // 1초 뒤에 튕기기 시작
});
